SST.description:
EF SST '6F38' (SIM service table): This EF indicates which services are allocated, and whether,
                  if allocated, the service is activated. If a service is not allocated or not activated in the SIM,
                  the ME shall not select this service.

LOCIGPRS.description:
EF LOCIGPRS '6F53' (GPRS location information): This EF contains the following Location Information:

                  - Packet Temporary Mobile Subscriber Identity (P-TMSI);
 - Packet Temporary Mobile Subscriber
                  Identity signature value (P-TMSI signature value);
 - Routing Area Information (RAI);

                  - Routing Area update status.
